import React, { Fragment } from "react";
import "./Project.css";
import ProjectData from "./ProjectData";

export default function Projects() {
  return (
    <section id="projects" className="card container-fluid p-3 my-3 ">
      <Fragment>
        <div
          className="container card-deck text-center lg:px-40"
          style={{ display: "flex", flexDirection: "row" }}
        >
          {ProjectData.map((item) => (
              <div className="flip-card p-3">
                <div className="flip-card-inner">
                  <div className="flip-card-front">
                    <h1>{item.title}</h1>
                  </div>
                  <div className="flip-card-back">
                      <h2 className="title-font font-medium text-green-400 mb-1">{item.subtitle}</h2>
                    <p>{item.details}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </Fragment>
    </section>
  );
}
